import React from "react";
import './Services.css';
import HeartEmoji from '../../img/heartemoji.png';
import Glasses from '../../img/glasses.png';   
import Humble from '../../img/humble.png';
import { Card } from "../Card/Card";
import Resume from './resume.pdf'

export const Services = () => {
    return(
        <div className="services">
            
            {/* left side  */}
            <div className="awesome">
                <span>Works for all these</span>
                <span>Brands and Clients </span>
                <span>Lorem is simpley dummy text for printing of printing Lorem
                    <br/>
                    isum is simpley text for printing
                    <br/>
                    isum is simpley text for printing text for printing
                    <br/>
                    
                </span>
                <a href={Resume} download>
                    <button className="button s-button">Download CV</button>
                </a>
                
                <div className="blur s-blur1" style={{background: '#ABF1FF94'}}></div>
            </div>

            {/* right side */}
            <div className="cards">
                <div style={{left:'14rem'}}>

                        {/* First Card */}
                    <Card
                    emoji = {HeartEmoji}
                    heading = {'Design'}
                    detail = {'Figma, Sketch, Adobe, Adobe xd'}
                    />
                </div>

                <div style={{top: '12rem', left: '-4rem'}}>
                        {/* Second Card */}
                    <Card
                    emoji = {Glasses}
                    heading = {'Developer'}
                    detail = {'HTML, CSS, JavaScript, React'}
                    />
                </div>

                <div style={{top: '19rem', left: '12rem'}}>
                        {/* Third Card */}
                    <Card
                    emoji = {Humble}
                    heading = {'UI/UX'}
                    detail = {'Lorem ispum dummy text are usually use in section where'}
                    />
                </div>
                <div className="blur s-blur2" style={{background: 'var(--purple)'}}></div>

            </div>
        </div>

        
    )
}
